import React, { useState } from 'react';

const Settings = ({ isOpen, onClose }) => {
  const [activeTab, setActiveTab] = useState('general');
  const [settings, setSettings] = useState({
    general: {
      theme: 'light',
      language: 'en',
      autoRefresh: true,
      refreshInterval: 10,
      notifications: true
    },
    agents: {
      maxConcurrentTasks: 5,
      defaultTimeout: 300,
      retryAttempts: 3,
      logLevel: 'info'
    },
    api: {
      baseUrl: 'http://localhost:8000',
      timeout: 30,
      enableWebSocket: true,
      wsReconnectInterval: 5
    },
    ui: {
      compactMode: false,
      showTimestamps: true,
      animationsEnabled: true,
      soundEnabled: false
    }
  });

  const handleSettingChange = (category, key, value) => {
    setSettings(prev => ({
      ...prev,
      [category]: {
        ...prev[category],
        [key]: value
      }
    }));
  };

  const handleSave = () => {
    // Save settings to localStorage or API
    localStorage.setItem('aiAgentHubSettings', JSON.stringify(settings));
    onClose();
  };

  const handleReset = () => {
    if (window.confirm('Are you sure you want to reset all settings to default?')) {
      localStorage.removeItem('aiAgentHubSettings');
      window.location.reload();
    }
  };

  if (!isOpen) return null;

  const tabs = [
    { id: 'general', label: 'General', icon: '‚öôÔ∏è' },
    { id: 'agents', label: 'Agents', icon: 'ü§ñ' },
    { id: 'api', label: 'API', icon: 'üîó' },
    { id: 'ui', label: 'Interface', icon: 'üé®' }
  ];

  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
      <div className="bg-white rounded-lg shadow-xl w-full max-w-4xl h-3/4 flex">
        {/* Sidebar */}
        <div className="w-1/4 bg-gray-50 rounded-l-lg border-r border-gray-200">
          <div className="p-4 border-b border-gray-200">
            <h2 className="text-lg font-semibold text-gray-800">Settings</h2>
          </div>
          <nav className="p-2">
            {tabs.map((tab) => (
              <button
                key={tab.id}
                onClick={() => setActiveTab(tab.id)}
                className={`w-full flex items-center space-x-3 px-3 py-2 rounded-lg text-left transition-colors ${
                  activeTab === tab.id
                    ? 'bg-blue-100 text-blue-700'
                    : 'text-gray-600 hover:bg-gray-100'
                }`}
              >
                <span className="text-lg">{tab.icon}</span>
                <span className="font-medium">{tab.label}</span>
              </button>
            ))}
          </nav>
        </div>

        {/* Content */}
        <div className="flex-1 flex flex-col">
          <div className="p-6 border-b border-gray-200 flex items-center justify-between">
            <h3 className="text-xl font-semibold text-gray-800">
              {tabs.find(t => t.id === activeTab)?.label} Settings
            </h3>
            <button
              onClick={onClose}
              className="p-2 text-gray-400 hover:text-gray-600 rounded-lg hover:bg-gray-100"
            >
              <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
              </svg>
            </button>
          </div>

          <div className="flex-1 overflow-y-auto p-6">
            {/* General Settings */}
            {activeTab === 'general' && (
              <div className="space-y-6">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">Theme</label>
                  <select
                    value={settings.general.theme}
                    onChange={(e) => handleSettingChange('general', 'theme', e.target.value)}
                    className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
                  >
                    <option value="light">Light</option>
                    <option value="dark">Dark</option>
                    <option value="auto">Auto</option>
                  </select>
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">Language</label>
                  <select
                    value={settings.general.language}
                    onChange={(e) => handleSettingChange('general', 'language', e.target.value)}
                    className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
                  >
                    <option value="en">English</option>
                    <option value="es">Spanish</option>
                    <option value="fr">French</option>
                    <option value="de">German</option>
                  </select>
                </div>

                <div className="flex items-center justify-between">
                  <div>
                    <label className="block text-sm font-medium text-gray-700">Auto Refresh</label>
                    <p className="text-sm text-gray-500">Automatically refresh data</p>
                  </div>
                  <input
                    type="checkbox"
                    checked={settings.general.autoRefresh}
                    onChange={(e) => handleSettingChange('general', 'autoRefresh', e.target.checked)}
                    className="w-4 h-4 text-blue-600 rounded focus:ring-blue-500"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Refresh Interval (seconds)
                  </label>
                  <input
                    type="number"
                    min="5"
                    max="300"
                    value={settings.general.refreshInterval}
                    onChange={(e) => handleSettingChange('general', 'refreshInterval', parseInt(e.target.value))}
                    className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
                  />
                </div>
              </div>
            )}

            {/* Agent Settings */}
            {activeTab === 'agents' && (
              <div className="space-y-6">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Max Concurrent Tasks
                  </label>
                  <input
                    type="number"
                    min="1"
                    max="20"
                    value={settings.agents.maxConcurrentTasks}
                    onChange={(e) => handleSettingChange('agents', 'maxConcurrentTasks', parseInt(e.target.value))}
                    className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Default Timeout (seconds)
                  </label>
                  <input
                    type="number"
                    min="30"
                    max="3600"
                    value={settings.agents.defaultTimeout}
                    onChange={(e) => handleSettingChange('agents', 'defaultTimeout', parseInt(e.target.value))}
                    className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">Retry Attempts</label>
                  <input
                    type="number"
                    min="0"
                    max="10"
                    value={settings.agents.retryAttempts}
                    onChange={(e) => handleSettingChange('agents', 'retryAttempts', parseInt(e.target.value))}
                    className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">Log Level</label>
                  <select
                    value={settings.agents.logLevel}
                    onChange={(e) => handleSettingChange('agents', 'logLevel', e.target.value)}
                    className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
                  >
                    <option value="debug">Debug</option>
                    <option value="info">Info</option>
                    <option value="warning">Warning</option>
                    <option value="error">Error</option>
                  </select>
                </div>
              </div>
            )}

            {/* API Settings */}
            {activeTab === 'api' && (
              <div className="space-y-6">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">Base URL</label>
                  <input
                    type="url"
                    value={settings.api.baseUrl}
                    onChange={(e) => handleSettingChange('api', 'baseUrl', e.target.value)}
                    className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Request Timeout (seconds)
                  </label>
                  <input
                    type="number"
                    min="5"
                    max="300"
                    value={settings.api.timeout}
                    onChange={(e) => handleSettingChange('api', 'timeout', parseInt(e.target.value))}
                    className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
                  />
                </div>

                <div className="flex items-center justify-between">
                  <div>
                    <label className="block text-sm font-medium text-gray-700">Enable WebSocket</label>
                    <p className="text-sm text-gray-500">Real-time updates via WebSocket</p>
                  </div>
                  <input
                    type="checkbox"
                    checked={settings.api.enableWebSocket}
                    onChange={(e) => handleSettingChange('api', 'enableWebSocket', e.target.checked)}
                    className="w-4 h-4 text-blue-600 rounded focus:ring-blue-500"
                  />
                </div>
              </div>
            )}

            {/* UI Settings */}
            {activeTab === 'ui' && (
              <div className="space-y-6">
                <div className="flex items-center justify-between">
                  <div>
                    <label className="block text-sm font-medium text-gray-700">Compact Mode</label>
                    <p className="text-sm text-gray-500">Reduce spacing and padding</p>
                  </div>
                  <input
                    type="checkbox"
                    checked={settings.ui.compactMode}
                    onChange={(e) => handleSettingChange('ui', 'compactMode', e.target.checked)}
                    className="w-4 h-4 text-blue-600 rounded focus:ring-blue-500"
                  />
                </div>

                <div className="flex items-center justify-between">
                  <div>
                    <label className="block text-sm font-medium text-gray-700">Show Timestamps</label>
                    <p className="text-sm text-gray-500">Display timestamps in logs and messages</p>
                  </div>
                  <input
                    type="checkbox"
                    checked={settings.ui.showTimestamps}
                    onChange={(e) => handleSettingChange('ui', 'showTimestamps', e.target.checked)}
                    className="w-4 h-4 text-blue-600 rounded focus:ring-blue-500"
                  />
                </div>

                <div className="flex items-center justify-between">
                  <div>
                    <label className="block text-sm font-medium text-gray-700">Animations</label>
                    <p className="text-sm text-gray-500">Enable UI animations and transitions</p>
                  </div>
                  <input
                    type="checkbox"
                    checked={settings.ui.animationsEnabled}
                    onChange={(e) => handleSettingChange('ui', 'animationsEnabled', e.target.checked)}
                    className="w-4 h-4 text-blue-600 rounded focus:ring-blue-500"
                  />
                </div>

                <div className="flex items-center justify-between">
                  <div>
                    <label className="block text-sm font-medium text-gray-700">Sound Notifications</label>
                    <p className="text-sm text-gray-500">Play sounds for notifications</p>
                  </div>
                  <input
                    type="checkbox"
                    checked={settings.ui.soundEnabled}
                    onChange={(e) => handleSettingChange('ui', 'soundEnabled', e.target.checked)}
                    className="w-4 h-4 text-blue-600 rounded focus:ring-blue-500"
                  />
                </div>
              </div>
            )}
          </div>

          {/* Footer */}
          <div className="p-6 border-t border-gray-200 flex items-center justify-between">
            <button
              onClick={handleReset}
              className="px-4 py-2 text-red-600 border border-red-300 rounded-lg hover:bg-red-50 transition-colors"
            >
              Reset to Default
            </button>
            <div className="flex space-x-3">
              <button
                onClick={onClose}
                className="px-4 py-2 text-gray-600 border border-gray-300 rounded-lg hover:bg-gray-50 transition-colors"
              >
                Cancel
              </button>
              <button
                onClick={handleSave}
                className="px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors"
              >
                Save Changes
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Settings;
